import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Define the Weather component
function Weather() {
  return (
    <div className="full-page">
      <h1>Today's weather is:</h1>
      {/* This could be expanded to include actual weather data */}
    </div>
  );
}

function Report() {
  return (
    <div className="full-page">
      <h1>Today's weather is:</h1>
      {/* This could be expanded to include actual weather data */}
    </div>
  );
}

function SixHourReport() {
  return (
    <div className="hour-report-container">
      <h1>You reported 6 hours of driving today.</h1>
    </div>
  );
}

// Component for reporting 8 hours
function EightHourReport() {
  return (
    <div className="hour-report-container">
      <h1>You reported 8 hours of driving today.</h1>
    </div>
  );
}

// Component for reporting 9 hours
function NineHourReport() {
  return (
    <div className="hour-report-container">
      <h1>You reported 9 hours of driving today.</h1>
    </div>
  );
}

// Define the main App component
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={
          <div className="App">
            <header className="App-header">
              <h1>Welcome to Schneider Truck</h1>
            </header>
            <nav className="App-nav">
              <Link to="/destination" className="nav-button">Enter Your Destination</Link>
              <Link to="/report" className="nav-button">Report Time</Link>
              <Link to="/weather" className="nav-button">Weather Today</Link>
              <Link to="/about_us" className="nav-button">About US</Link>
              <Link to="/community_tips" className="nav-button">Community Tips</Link>
              <Link to="/driving_summary" className="nav-button">Driving Summary</Link>
              <Link to="/community_support" className="nav-button">Community Support</Link>
            </nav>
          </div>
        } />
        <Route path="/weather" element={<Weather />} />
        <Route path="/report" element={<Report />} />
          <Route path="/report/6hour" element={<SixHourReport />} />
          <Route path="/report/8hour" element={<EightHourReport />} />
          <Route path="/report/9hour" element={<NineHourReport />} />
      </Routes>
    </Router>
  );
}

export default App;
